import { items } from "./seo";
import React from "react";
import "./nav.css";
import { ReactSearchAutocomplete } from "react-search-autocomplete";

function Nav() {
  const handleOnSearch = (string, results) => {
    // onSearch will have as the first callback parameter
    // the string searched and htmlFor the second the results.
    results.slice(1, 5);
    console.log(string, results);
  };

  const handleOnHover = (result) => {
    // the item hovered
    console.log(result);
  };

  const handleOnSelect = (item) => {
    // the item selected
    console.log(item);
  };

  const handleOnFocus = () => {
    console.log("Focused");
  };

  const htmlFormatResult = (item) => {
    return (
      <>
        {/* <span style={{ display: 'block', textAlign: 'left' }}>id: {item.id}</span> */}
        <span
          style={{ display: "block", textAlign: "left", visibility: "visible" }}
        >
          {item.name}
        </span>
      </>
    );
  };
  return (
    <nav classNameName="navbar navbar-expand-lg navbar-dark bg-dark">
      {/* <div classNameName="container"> */}
      <a classNameName="navbar-brand" href="#" id="brand">
        <img
          src="logo192.png"
          style={{ height: "30px", width: "30px" }}
          alt="React"
        />{" "}
        React
      </a>
      <button
        classNameName="navbar-toggler"
        type="button"
        data-bs-toggle="collapse"
        data-bs-target="#navbarNav"
        aria-controls="navbarNav"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span classNameName="navbar-toggler-icon"></span>
      </button>
      <div classNameName="collapse navbar-collapse" id="navbarNav">
        <ul classNameName="navbar-nav">
          <li classNameName="nav-item">
            <a
              classNameName="nav-link active"
              id="active"
              aria-current="page"
              href="#"
            >
              Home
            </a>
          </li>
          <li classNameName="nav-item">
            <a classNameName="nav-link" href="#">
              About
            </a>
          </li>
          <li classNameName="nav-item">
            <a classNameName="nav-link" href="#">
              Contact
            </a>
          </li>
          <li classNameName="nav-item">
            <a classNameName="nav-link" href="#">
              More
            </a>
          </li>
        </ul>
        <ReactSearchAutocomplete
          items={items}
          onSearch={handleOnSearch}
          onHover={handleOnHover}
          onSelect={handleOnSelect}
          onFocus={handleOnFocus}
          autoFocus
          htmlFormatResult={htmlFormatResult}
        />

        <div classNameName="cta">
          <button
            classNameName="btn"
            style={{ color: "#333333", background: "#f2f2f2" }}
            id="login"
          >
            Login
          </button>
          <button classNameName="btn btn-primary" id="signup">
            Sign Up
          </button>
        </div>
      </div>
      <div classNameName="login-htmlForm container">
        <div classNameName="row">
          <div classNameName="col">
            <div classNameName="card p4">
              <htmlForm>
                <div className="htmlForm-floating mb-3">
                  <input
                    type="email"
                    className="htmlForm-control"
                    id="floatingInput"
                    placeholder="name@example.com"
                  />
                  <label htmlFor="floatingInput">Email address</label>
                </div>
                <div className="htmlForm-floating">
                  <input
                    type="password"
                    className="htmlForm-control"
                    id="floatingPassword"
                    placeholder="Password"
                  />
                  <label htmlFor="floatingPassword">Password</label>
                </div>
              </htmlForm>
            </div>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
